class Player{
	constructor(x, y, w, h){
		this.x = x;
		this.y = y;
		this.w = w;
		this.h = h;
		this.vx = 0;
		this.vy = 0;
		this.gravity = 0.15;
		this.onground = false;
		this.sprite = new SpriteImage({
			pos: {x: 0, y: 0},
			s: {w: 16, h: 16},
			max: {x: 64, y: 48},
			oldPos: {x: 0, y: 0},
			top: false,
			left: true,
			fps: 4,
			play: true,
		}, "player.png");
		this.particles = [];

		this.a = 0;
		this.s = 0;
		this.t = 16;
		this.dash = false;
		
		this.walkingAudio =
		new Audio("data:audio/wav;base64,");
		this.walkingAudio.controls = true;
		
		this.jumpAudio =
		new Audio("data:audio/wav;base64,");
		this.jumpAudio.controls = true;

		// document.body.appendChild(this.audio);
// audio.play();
	}
	update() {

		this.x += this.vx;
		this.y += this.vy;
		this.a += this.vx * 5;

		con.translate(-this.vx, -this.vy);
		if ((keyDown.a || keyDown.d) & this.onground & !(keyDown.a && keyDown.d))
			this.walkingAudio.play();

		if (keyDown.a & !keyDown.d) {
			this.sprite.p.pos.y = 32;
			if (this.s != 0)
				this.vx = -4 * this.s;
			else this.vx = -4;
			



			if (keyDown.Shift && !this.dash && this.vy != 0) {
				this.s += 16;
				this.dash = true;
				// for (var i = 0; i < 10; i++) {
					this.particles.push(new Particle(this.x + this.w - this.s + 4, this.y + random(0, this.h), random(1,8), random(1,8), 2, 1, 40, 'rgba(0, 0, 0, 1)'));
				// }
				
			}
			else {
				this.s = 0;
				if (this.onground)
					this.particles.push(new Particle(this.x + this.w - 4, this.y + this.h, random(1,2), random(1,2), 2, 1, 40, 'rgba(0, 0, 0, 1)'));
			}
		}
		else if (keyDown.d & !keyDown.a) {
			this.sprite.p.pos.y = 16;
			if (this.s != 0)
				this.vx = 4 * this.s;
			else this.vx = 4;




			if (keyDown.Shift && !this.dash && this.vy != 0) {
				this.s += 16;
				this.dash = true;
				// for (var i = 0; i < 10; i++) {
					this.particles.push(new Particle(this.x - this.s + 4, this.y + random(0, this.h), random(1,8), random(1,8), -1, 1, 40, 'rgba(0, 0, 0, 1)'));
				// }
			}
			else {
				this.s = 0;
				if (this.onground)
					this.particles.push(new Particle(this.x + 4, this.y + this.h, random(1,2), random(1,2), -1, 1, 40, 'rgba(0, 0, 0, 1)'));
			}
		}
		else 
			this.vx = 0,
			this.sprite.p.pos.y = 0;

		if (this.dash && this.t > 0)
			this.t -= 1;
		if (this.t <= 0)
			this.t = 32,
			this.dash = false;


		if (this.vy < 0)
			this.sprite.p.fps = 32;
		else
			this.sprite.p.fps = 6;

		if (keyDown.space && this.onground) {
			this.vy = -4;
			this.gravity = 0;
			this.onground = false;
			this.jumpAudio.play();
			for (var i = 0; i < 5; i++) {
				this.particles.push(new Particle(this.x + random(-this.w, this.w*2), this.y + this.h + random(0, 3), random(1, 4), random(1, 4), 2, 1, 40, 'rgba(0, 0, 0, 1)'));
			}
		}
		else this.vy += this.gravity, this.gravity = 0.2;

		for (var i = 0; i < this.particles.length; i++) {
			this.particles[i].update();
			if (this.particles[i].t > this.particles[i].c)
				this.particles.splice(i, 1);
		}
		// fillRect(this.x, this.y, this.w, this.h, 'black');
		this.sprite.update(this.x, this.y, this.w, this.h, "player.png", this.t > 0 && this.dash ? this.a : 0, this.vx, this.vy)
	}
}